import React from 'react';
import { IconStyle } from './assets/iconfont/iconfont';
import { GlobalStyle } from  './style';

function App() {
  return (
    <div className="App">
      <GlobalStyle></GlobalStyle>
      <IconStyle></IconStyle>
      <i className="iconfont">&#xe642;</i>
    </div>
  );
}

export default App;
